import React from "react";
import Item from "./Item";
import withContext from "./withContext";

const ProductList = props => {
    const { products } = props.context;


    return (<div>

        {products.length > 0 ?
            <div>
                {products.map((product, index) => (
                    <Item
                        product={product}
                        key={index} />
                ))}
            </div> : <div></div>}

    </div>)



}

export default withContext(ProductList);;
